import React from "react";
import { RouteComponentProps, match } from "react-router";

interface Prop extends RouteComponentProps<{ id: string }> {}
function About({ match }: Prop) {
  return (
    <div>
      <h1>{match.params.id}</h1>
    </div>
  );
}

export default About;
